(1, '404 Not Found 1', 'one_column', 'Page keywords', 'Page description', 'no-route', NULL, '<div id="jm-error">\r\n<div class="page-head-alt">\r\n<h3>Whoops...</h3>\r\n</div>\r\n<dl><dt>The page you requested was not found, and we have a fine guess why.</dt><dd>\r\n<ul class="disc">\r\n<li>If you typed the URL directly, please make sure the spelling is correct.</li>\r\n<li>If you clicked on a link to get here, the link is outdated.</li>\r\n</ul>\r\n</dd></dl>\r\n<dl><dt>What can you do?</dt><dd>Have no fear, help is near! There are many ways you can get back on track with Magento Demo Store.</dd><dd>\r\n<ul class="disc">\r\n<li><a onclick="history.go(-1);" href="#">Go back</a> to the previous page.</li>\r\n<li>Use the search bar at the top of the page to search for your products.</li>\r\n<li>Follow these links to get you back on track!<br /><a href="{{store url=""}}">Store Home</a><br /><a href="{{store url="customer/account"}}">My Account</a></li>\r\n</ul>\r\n</dd></dl></div>', '2007-06-20 18:38:32', '2012-08-22 03:45:14', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
